// The component's store and logic
// Functional-style with immutable.js for fast fast fast react

SCHOOL_TARGETING_SIGNIFICANT_FIGURES = 3;

var SchoolTargetingStore = function(opts){
  // Add to schools the info to whether they are selected or not
  schools = _.map(opts.schools, function(school){
    school.selected = _.include(opts.selected, school.id);
    return school;
  });

  // Store them in a list
  this.schools = schools;

  // Also store current tab, query, and only_selected filters
  this.tab = opts.filters.tab;
  this.query = opts.filters.query;
  this.onlySelected = opts.onlySelected || null;

  // Also store available baskets and the current one
  this.baskets = opts.school_baskets;
  this.currentBasketIndex = -1;
};

// Getters
SchoolTargetingStore.prototype.displayedTopSchools = function(){
  var self = this;
  return _(this.schools).filter(function(school){
    return school.top_school && self._displaySchool(school);
  }).sortBy('name').value();
};

SchoolTargetingStore.prototype.displayedOtherSchools = function(){
  var self = this;
  return _(this.schools).filter(function(school){
    return !school.top_school && self._displaySchool(school);
  }).sortBy('name').value();
};

SchoolTargetingStore.prototype.currentTab = function(){
  return this.onlySelected || this.tab;
};

SchoolTargetingStore.prototype.currentQuery = function(){
  return this.query;
};

SchoolTargetingStore.prototype.currentOnlySelected = function(){
  return this.onlySelected;
};

SchoolTargetingStore.prototype.estimatedAudience = function(){
  var total = _.sum( _.map(this._selectedSchools(), _.property('students_count') ) );
  return this._floorSig(total, SCHOOL_TARGETING_SIGNIFICANT_FIGURES);
};

SchoolTargetingStore.prototype.estimatedSchoolsCount = function(kind){
  var schools = this._selectedSchools();
  if (kind) { schools = _.filter(schools, 'kind', kind); }
  return schools.length;
};

SchoolTargetingStore.prototype.selectedSchoolIds = function(){
  return _.map( this._selectedSchools(), _.property('id') );
};

SchoolTargetingStore.prototype.selectedSchoolCountByKind = function(kind){
  return _.filter( this._selectedSchools(), 'kind', kind ).length;
};

SchoolTargetingStore.prototype.totalSchoolCountByKind = function(kind){
  var self = this;
  return _.filter(this.schools, function(school){
    return ( school.kind == kind && school.name.match(new RegExp(self.query, 'i')) );
  }).length;
};

SchoolTargetingStore.prototype.availableBaskets = function(){
  var self = this;
  return _.map(this.baskets, function(basket, index){
    return {
      name: basket.name,
      index: index
    };
  });
};

// "Setters" (immutable syntax but still destructive, beware!)
SchoolTargetingStore.prototype.withFilter = function(filter){
  if (_.has(filter, 'tab')) {
    this.onlySelected = null;
    this.tab = filter.tab;
  }
  if (_.has(filter, 'query')) { this.query = filter.query; }
  if (_.has(filter, 'onlySelected')) {
    if (filter.onlySelected == this.onlySelected) {
      this.onlySelected = null;
    }
    else {
      this.tab = filter.onlySelected;
      this.onlySelected = filter.onlySelected;
    }
  }

  return this;
};

SchoolTargetingStore.prototype.withToggle = function(schoolId){
  // Cancel the basket selection
  this.currentBasketIndex = -1;

  school = _.find( this.schools, 'id', schoolId );
  school && ( school.selected = !school.selected );

  return this;
};

SchoolTargetingStore.prototype.withBasket = function(basketIndex){
  this.currentBasketIndex = basketIndex;

  if (basketIndex >= 0) {
    var basketSchools = this.baskets[basketIndex].school_ids;

    _.each(this.schools, function(school){
      school.selected = _.includes(basketSchools, school.id);
    });
  }

  return this;
};

// "Private" helpers
// All the selected schools
SchoolTargetingStore.prototype._selectedSchools = function(){
  return _.filter(this.schools, 'selected');
};

// Check if a school matches the filters
SchoolTargetingStore.prototype._displaySchool = function(school){
  return ( school.kind == (this.onlySelected || this.tab) && school.name.match(new RegExp(this.query, 'i')) && (!this.onlySelected || school.selected) );
};

// Round an integer down to 2 relevant digits
SchoolTargetingStore.prototype._floorSig = function(number, sig_count){
  var digits = number.toString().length;
  if (digits <= sig_count) {
    return number
  }
  var divider = Math.pow(10, digits - sig_count);
  return ( Math.floor(number / divider) ) * divider;
};
