// Callback to trigger tracking on a link
$(document).on('mousedown', 'a, span[data-track], button[data-track]', function () {
  // If we have defined a custom event...
  var trackData = $(this).data('track');
  var destinationUrl = $(this).attr('href');
  if (trackData) {
    if (!trackData.destinationUrl && destinationUrl) trackData.destinationUrl = destinationUrl;
    JT.DataLayer.trackEvent(trackData.event, _.omit(trackData, 'event'));
    return;
  }

  // is it an asset download event ?
  if (destinationUrl && (destinationUrl.match(/system\/press/) || destinationUrl.match(/assets\/press/))) {
    trackData = {};
    trackData['event'] = 'press.asset.download';
    trackData['asset'] = destinationUrl.split(/[\\/]/).pop(); // getting the basename in url (eg: file.pdf)
    JT.DataLayer.trackEvent(trackData.event, _.omit(trackData, 'event'));
    return;
  }

  // is it an outbound link ?
  if ((this.protocol === 'http:' || this.protocol === 'https:') &&
      this.hostname.indexOf(document.location.hostname) === -1 &&
      destinationUrl) {

    // Used to determine if the current clicked link is in the useful links container
    // if length == 0 (falsy in JS), current link is not in useful links container
    var isInUsefulLinksContainer = $(this).parents('#useful-links').length;

    if (dataLayer[0].contentType == 'Company' && dataLayer[0].contentId) {
      JT.DataLayer.trackEvent('companies.outboundLink.click', { destinationUrl: destinationUrl })
    } else if (dataLayer[0].controller == 'dashboards' && isInUsefulLinksContainer) {
      JT.DataLayer.trackEvent('studentDashboard.usefulLinks.click', { destinationUrl: destinationUrl })
    } else {
      JT.DataLayer.trackEvent('global.outboundLink.click', { destinationUrl: destinationUrl })
    }

  }
});

// Callback to trigger tracking on a form submit
$('body').on('submit', 'form[data-track]', function () {
  var trackData = $(this).data('track');
  if (trackData) {
    JT.DataLayer.trackEvent(trackData.event, _.omit(_.extend(trackData, {currentUrl: window.location.href}), 'event'));
  }
});


