$('body').on('submit', '.job-offer-candidacy-popup form', function onSubmit() {
  var resumeType = $(this).
    find('input[type=radio][name="applicant[resume_type]"]:checked').attr('value');

  var humanizeResumeType = resumeType === 'profile_resume' ? 'Default Resume' : 'Custom Resume';

  JT.DataLayer.trackEvent(
    'jobOffers.applyForm.submit',
    { trackUserAction: true, resumeType: humanizeResumeType }
  );
});

$('body').on('submit', '.jobteaser-invite-popup form', function onSubmit() {
  var resumeType = null;
  var humanizedResumeType = null;
  var subEventIds = null;

  resumeType = $(this).
    find('input[type=radio][name="applicant[resume_type]"]:checked').attr('value');

  // event could or could not ask for CV
  if (resumeType == null) {
    humanizedResumeType = null;
  } else {
    humanizedResumeType = (resumeType === 'profile_resume') ? 'Default Resume' : 'Custom Resume';
  }

  if ($(this).find('.sub-events').length) {
    subEventIds = $(this).
      find('input[name="applicant[sub_event_ids][]"]').
      map(function value() { return this.value; }).
      get().
      join(';');
  }

  JT.DataLayer.trackEvent(
    'events.applyForm.submit',
    { resumeType: humanizedResumeType, subEventIds: subEventIds }
  );
});
