// Allow passing complex prop structures to vue components either as json or
// native objects / arrays
var PropsSerializer = function PropsSerializer() {
  return {
    serializedProp: function serializedProp(opts) {
      return {
        coerce: function coerce(json) {
          if (!json) return opts.default;
          if (_.isString(json)) return JSON.parse(json);
          return json;
        },
      };
    },
  };
};

JT.VueComponents.PropsSerializer = PropsSerializer;
