//
// this component handles two steps display
// use v-show="currentStep == X" to display X steps
// use defaultStep props to change first step displayed
// call nextStep and prevStep to display move to the next step
//
// if the component is attached to a form (this.$el.tagName === 'FORM')
// nextStep() checked each input validity before moving to next step
//
// XStepDisplay component SHOULD be linked to a form element to
// commit form validation before moving to nextStep
//
var XStep = Vue.extend({

  props: ['step'],

  methods: {

    nextStep: function nextStep() {
      var that = this;
      var inputs = _.filter(that.$el.getElementsByTagName('input'), that.required);
      if (_.every(inputs, that.checkRequiredInputValidity)) {
        that.$parent.nextStep();
      } else {
        // trigger browser validation and display browser native bubbles
        this.$parent.commitForm();
      }
    },

    prevStep: function prevStep() {
      this.$parent.prevStep();
    },

    checkRequiredInputValidity: function checkRequiredInputValidity(value) {
      return value.checkValidity();
    },

    required: function required(element) {
      return element.required;
    },

  },

});

var XStepsDisplay = Vue.extend({

  props: ['defaultStep'],

  data: function data() {
    return {
      currentStep: this.defaultStep || 1,
    };
  },

  methods: {

    nextStep: function nextStep() {
      this.currentStep++;
    },

    prevStep: function prevtStep() {
      this.currentStep--;
    },

    commitForm: function commitForm() {
      var commit = null;
      var disabled = null;
      if (this.$el.tagName === 'FORM' && this.$el.elements.commit) {
        commit = this.$el.elements.commit;

        // commit button should not be disabled to trigger click correctly
        disabled = commit.disabled;
        if (disabled) {
          commit.disabled = false;
        }

        commit.click();

        if (disabled) {
          commit.disabled = true;
        }
      }
    },

  },

  components: {
    'x-step': XStep,
  },

});

Vue.component('x-steps-display', XStepsDisplay);
