// this component handles sub events list display and
// interaction in different cases with different templates:
//  - in the subscription popup of an event
//  - in the sub events management popup

var SubEvent = Vue.extend({

  props: ['subEvent'],

  computed: {

    eventTypeClass: function eventTypeClass() {
      return {
        'sub-events__list--event-select': this.isSelect(),
        'sub-events__list--event-radio': this.isRadio(),
        'no-more': this.noMoreSubscription(),
      };
    },

    subEventClass: function subEventClass() {
      return {
        'subevent-full': this.subEvent.full && !this.subEvent.subscribed,
        'subevent-active': this.subEvent.subscribed,
      };
    },

  },

  ready: function ready() {
    // refresh all JT components of the sub events list (tooltips)
    $('.sub-events__list').initializeComponents();
  },

  methods: {

    goBack: function goBack() {
      history.go(0);
    },

    isSelect: function isSelect() {
      return this.$parent.eventTypeClass('select');
    },

    isRadio: function isRadio() {
      return this.$parent.eventTypeClass('radio');
    },

    noMoreSubscription: function noMoreSubscription() {
      return (this.maxSubEventSubscriptionsReached() && !this.subEvent.subscribed);
    },

    canSubscribe: function canSubscribe() {
      return !this.maxSubEventSubscriptionsReached() && !this.subEvent.full;
    },

    toggleActivation: function toggleActivation() {
      if (this.isRadio() && !this.subEvent.full) {
        this.$parent.unsubscribeAll();
      }
      if (this.canSubscribe() || this.subEvent.subscribed) {
        this.subEvent.subscribed = !this.subEvent.subscribed;
      }
    },

    fullTooltip: function fullTooltip() {
      var tooltipJson = null;
      if (this.subEvent.full && !this.subEvent.subscribed) {
        tooltipJson = {
          name: 'Tooltip',
          opts: {
            text: JT.I18n.sub_events.full,
            placement: 'top',
          },
        };

        return JSON.stringify(tooltipJson);
      }

      return false;
    },

    maxSubscriptionsReachedTooltip: function maxSubscriptionsReachedTooltip() {
      return this.maxSubEventSubscriptionsReached() && !this.subEvent.subscribed && !this.isRadio();
    },

    maxSubEventSubscriptionsReached: function maxSubEventSubscriptionsReached() {
      return this.$parent.maxSubEventSubscriptionsReached();
    },

    subscribe: function subscribe(swapOptionId) {
      var params = null;
      if (swapOptionId) {
        params = '?other_sub_event_id=' + swapOptionId;
      } else {
        params = '';
      }

      this.$parent.makeApiCall(this.subEvent.subscribe_path + params, 'POST');
    },

    unsubscribe: function unsubscribe() {
      this.$parent.makeApiCall(this.subEvent.unsubscribe_path, 'DELETE');
    },

  },
});

var SubEventsList = Vue.extend({

  data: function data() {
    return {
      working: false,
      dirty: false,
    };
  },

  props: ['event', 'days', 'errorMessage', 'swapOptions'],

  methods: {

    unsubscribeAll: function unsubscribeAll() {
      _.each(this.subEventsSubscriptions(), function unsubscribed(subEvent) {
        subEvent.subscribed = false; // eslint-disable-line no-param-reassign
      });
    },

    eventTypeClass: function eventTypeClass(type) {
      return this.event.mode === type;
    },

    maxSubEventSubscriptionsReached: function maxSubEventSubscriptionsReached() {
      return this.event.max_sub_event_subscriptions === this.nbSubEventsSubscriptions();
    },

    subEvents: function subEvents() {
      return _.flatten(_.map(this.days, function subEvent(day) {
        return day[1];
      }));
    },

    nbSubEventsSubscriptions: function nbSubEventsSubscriptions() {
      return _.size(this.subEventsSubscriptions());
    },

    subEventsSubscriptions: function subEventsSubscriptions() {
      return _.filter(this.subEvents(), function getSubcribed(subEvent) {
        return subEvent.subscribed;
      });
    },

    canClickSubscribe: function canClickSubscribe() {
      if (this.event.mandatory_sub_event) {
        return this.nbSubEventsSubscriptions() >= 1;
      }

      return true;
    },

    makeApiCall: function makeApiCall(url, method) {
      var self = this;
      self.working = true;
      self.dirty = true;
      $.ajax(url, {
        success: function success(response) {
          self.working = false;
          self.$set('days', response.days);
          self.$set('swapOptions', response['swap-options']);
        },
        error: function error() {
          self.working = false;
          JT.Notifications.error(self.errorMessage);
        },
        method: method,
      });
    },

  },

  // setup of an inner component which handles each sub event
  // in the sub events list; the sub event component calls
  // some $parent methods
  components: {
    'sub-event': SubEvent,
  },

});

Vue.component('sub-events-list', SubEventsList);
