Vue.component('onboarding-carousel', {
  template: '<div class="modal fade" tabindex="-1" role="dialog" aria-labelledby="gridSystemModalLabel">' +
              '<div class="modal-dialog modal-dialog--large" role="document">' +
                '<div class="modal-content">' +
                '</div>' +
              '</div>' +
            '</div>',
  props: {
    templateSelector: String
  },
  ready: function () {
    var $el = $(this.$el);
    $el.find('.modal-content').append($(this.templateSelector).html());

    this.initCarousel();

    $el.modal({
      backdrop: 'static'
    });
  },

  methods: {
    // Initialize carousel state + events listeners
    initCarousel: function () {
      var $el = $(this.$el);
      var slides = $el.find('.slide');

      // init DOM
      this.createBullets(slides.length);

      // init states
      $el.find('.slide').hide();
      this.initEventListeners(slides);
    },

    initEventListeners: function (slides) {
      var $el = $(this.$el),
          that = this,
          nextSlideButtons = $el.find('.next-slide'),
          bulletsButtons = $el.find('.bullets-container .bullet'),
          currentIndex = this.changeSlide(0, 0, slides);

      nextSlideButtons.on('click', function () {
        currentIndex = that.changeSlide(currentIndex, currentIndex + 1, slides);
      });
      bulletsButtons.on('click', function (event) {
        currentIndex = that.changeSlide(currentIndex, $(event.currentTarget).data('slide-id'), slides);
      });
    },

    // Change current slide and maintain states
    changeSlide: function (previous, next, slides) {
      var $el = $(this.$el);
      if (next >= slides.length) {
        $el.modal('hide');
      } else {
        this.setActiveBullet(next);
        $(slides[previous]).hide();
        $(slides[next]).show();
      }

      this.dataLayerTrackEvent(next + 1);

      return next;
    },

    setActiveBullet: function (index) {
      var $el = $(this.$el);
      $el.find('.bullets-container .bullet').removeClass('active txt-color');
      $($el.find('.bullets-container .bullet')[index]).addClass('active txt-color');
    },

    createBullets: function (count) {
      var $el = $(this.$el),
          $container = $('<ul class="bullets-container modal-content__bullets-container"></ul>'),
          i;

      for (i = 0; i < count; i++) {
        $container.append('<li class="bullet modal-content__bullet" data-slide-id="' + i + '">&nbsp;</li>');
      }

      $el.find('.modal-content').append($container);
    },

    dataLayerTrackEvent: function(slideIndex) {
      JT.DataLayer.trackEvent('careerCenter.onboardingModal.open', {
        onboardingModalNb: slideIndex
      })
    }
  }
});
