//
// Add a custom input with an autocomplete which will get
// on the path given as a prop
//
// It will dispatch a autocomplete-change when a value is selected
//
// It accepts following props:
//  - id: id of the input added by the component
//  - name: name of the input added by the component
//  - value: value of the input added by the component
//  - classes: array of classes added to the input
//  - defaultValue: value added to the autocomplete list
//  - path: path used to fetch list of values
//  - queryParamName: param name used to fetch list of values
//
// TODO: (by ludovic) we should not use jquery typeahead and develop (or use)
// a solution developed with Vue.js.
//
// Custom filter used to join css classes' list
Vue.filter('join', function joinFilter(value) {
  if (typeof value === 'string') {
    return value;
  }

  if (value && typeof value.join === 'function') {
    return value.join(' ');
  }

  return '';
});

Vue.component('autocomplete', {
  /* eslint-disable max-len */
  template: '<input class="{{classes | join}}" id={{id}} name={{name}} type="text" value={{value}}></input>',
  /* eslint-enable max-len */

  props: {
    id: String,
    name: String,
    value: String,
    classes: [String, Array],
    defaultValue: String,
    path: String,
    queryParamName: {
      type: String,
      default: 'term',
    },
  },

  ready: function ready() {
    var jqueryEl = $(this.$el);
    this.typeahead = jqueryEl.typeahead({
      source: this.search,
      matcher: this.matcher,
    });

    $(this.$el).on('change', this.notify);

    // disable browser native autocomplete
    this.$el.setAttribute('autocomplete', 'off');
  },

  methods: {
    matcher: function matcher(item) {
      if (this.showDefaultValue && (item === this.defaultValue)) {
        return true;
      }

      return this.defaultMatcher.call(this.typeahead.data('typeahead'), item);
    },

    search: function search(query, cb) {
      var self = this;
      $.getJSON(this.queryPath(query), function success(data) {
        if (data.length === 0 && self.defaultValue) {
          self.showDefaultValue = true;
          return cb([self.defaultValue]);
        }

        self.showDefaultValue = false;
        return cb(_.pluck(data, 'value'));
      });
    },

    notify: function notify() {
      this.$dispatch('autocomplete-change', $(this.$el).val());
    },
  },

  data: function data() {
    return {
      showDefaultValue: false,

      typeahead: null,

      queryPath: function queryPath(query) {
        var queryType = /[?]/.test(this.path) ? '&' : '?';
        return this.path + queryType + this.queryParamName + '=' + query;
      },

      defaultMatcher: $.fn.typeahead.Constructor.prototype.matcher,
    };
  },
});
