/* global Vue, $, _, JT */

// extend multiselect vue component and add following features:
//  - grouped checkboxes in multiselect
//  - one click group selection (and deselection)
//
// main difference comes from the new template which add optgroup to select tag
var GroupedMultiselect = Vue.component('grouped-multiselect', {
  extends: JT.VueComponents.Multiselect,
  template: '<select v-model="values" multiple=true name="{{name}}">' +
              '<optgroup v-for="optgroup in options" :label="optgroup.label">' +
                '<option v-for="option in optgroup.value" v-bind:value="option.value">' +
                  '{{option.label}}' +
                '</option>' +
              '</optgroup>' +
            '</select>',

  ready: function ready() {
    // ready of multilselect component is implicitly called by Vue.js
    this.setupGroupedMultiselectListeners();
  },

  watch: {
    values: function watchValues() {
      this.multiselect.refresh();
    },
  },

  methods: {
    setupGroupedMultiselectListeners: function setupGroupedMultiselectListeners() {
      this.multiselect.$container.on(
        'click',
        '.multiselect-group',
        _.bind(this.onMultiselectGroupClick)
      );
    },

    // on multiselect group click, we need to add or remove all values of the group:
    //  - find the label of the clicked group
    //  - find the optgroup and all its options
    //  - map to extract all possibles values (id)
    //  - compute diff with currently selected values
    //  - if some values of the optgroup are not selected, add the diff to currently selected values
    //  - else remove all optgroup values from currently selected values
    onMultiselectGroupClick: function onMultiselectClick(event) {
      var optgLabel = $(event.target).text();
      var optgroup = _.find(
        this.options,
        function isOptg(optg) { return optg.label === optgLabel; }
      );
      var allValues = _.map(optgroup.value, function newValues(option) { return option.value; });
      var newValues = _.difference(allValues, this.values);

      if (newValues.length > 0) {
        this.values.push.apply(this.values, newValues);
      } else {
        // remove values from prop 'values' if it is present in allValues
        this.$set('values', _.difference(this.values, allValues));
      }

      // stop propagation to avoid multiselect closing
      event.stopPropagation();
    },
  },
});

