// extends grouped-multiselect vue component to add hidden options:
//  - add see more/less button at the end of the multiselect
//
// the component adds new props:
//  - blacklist: contains a list of values which should be hide at first display
//  - optionnal props:
//    - see-more: content of the see more button
//    - see-less: content of the see less button
Vue.component('blacklisted-grouped-multiselect', {
  extends: JT.VueComponents.GroupedMultiselect,
  template: '<select v-model="values" multiple=true name="{{name}}">' +
              '<optgroup v-for="optgroup in options" :label="optgroup.label">' +
                '<option v-for="option in optgroup.value" v-bind:value="option.value">' +
                  '{{option.label}}' +
                '</option>' +
              '</optgroup>' +
            '</select>',

  props: {
    // values are parse to int. To ease values and blacklist manipulation,
    // blacklist is parsed to int too.
    blacklist: {
      coerce: function coerce(json) {
        if (!json) return [];

        if (_.isString(json)) {
          return _.map(JSON.parse(json), _.parseInt);
        }

        return _.map(json, _.parseInt);
      },
    },
    seeMore: {
      type: String,
      default: JT.I18n.multiselect.see_more,
    },
    seeLess: {
      type: String,
      default: JT.I18n.multiselect.see_less + ' ' + JT.config.current_school_name,
    },
  },

  data: function data() {
    return {
      displayedNotBlacklistedOptions: true,
      allOptions: this.options,
      // button content change according to component state
      //  - if blacklisted options are displayed, see less content is displayed
      //  - if only not blacklisted options are displayed, see more content is displayed
      buttonHtml: function buttonHtml() {
        return '<li class="see-more-button text--custom --parent button"><a>' +
                 (this.displayedNotBlacklistedOptions ? this.seeMore : this.seeLess) +
               '</a></li>';
      },
    };
  },

  ready: function ready() {
    if (this.blacklist.length > 0) {
      // multiselect and grouped-multiselect ready function are implicitly called by Vue.js
      this.displayNotBlacklistedOptions();
      this.setupBlacklist();
    }
  },

  watch: {
    // rebuild multiselect and readd button when displayed options change
    options: function watchOptions() {
      this.multiselect.rebuild();
      this.addButton();
    },
  },

  methods: {
    // add see more button to the multiselect container
    // it cannot be added to the component template
    setupBlacklist: function setupBlacklist() {
      this.multiselect.$container.on(
        'click',
        '.see-more-button a',
        _.bind(this.onButtonClick)
      );
    },

    // stopImmediatePropagation is called to avoid scroll up
    // preventDefault is called to avoid closing of the multiselect
    onButtonClick: function onButtonClick(e) {
      e.stopImmediatePropagation();
      e.preventDefault();

      if (this.displayedNotBlacklistedOptions) {
        this.displayedNotBlacklistedOptions = false;
        this.displayAllOptions();
      } else {
        this.displayedNotBlacklistedOptions = true;
        this.displayNotBlacklistedOptions();
      }
    },

    addButton: function addButton() {
      this.multiselect.$container.find('ul').append(this.buttonHtml());
    },

    displayAllOptions: function displayAllOptions() {
      this.options = this.allOptions;
    },

    // called when see less button is clicked (on initialization too)
    // go through all options to remove blacklisted options and
    // optgroup when they are empty
    // remove from selected values all blacklisted values
    // (hidden options should not be selected)
    displayNotBlacklistedOptions: function displayNotBlacklistedOptions() {
      this.options = _.chain(this.allOptions).
        map(_.bind(this.filterOptgroups)).
        compact().
        value();

      this.values = _.difference(this.values, this.blacklist);
    },

    // remove all blacklisted options of an optgroup
    // return false if the new optgroup is empty to be removed by compact
    // in displayedNotBlacklistedOptions methods
    filterOptgroups: function filterOptgroups(optgroup) {
      var newOptgroup = {
        label: optgroup.label,
        value: _.filter(optgroup.value, _.bind(this.filterOptions)),
      };

      if (newOptgroup.value.length === 0) {
        return false;
      }

      return newOptgroup;
    },

    // return false if option is in the blacklist
    filterOptions: function filterOptions(option) {
      return !_.includes(this.blacklist, option.value);
    },
  },
});
