(function(window, routes, i18n) {

  var Navbar = Vue.extend({

    data: function() {
      return {
        routes: routes,
        i18n: i18n,
        calendarStartDate: ''
      }
    },

    props: ['advisorProfileId', 'current', 'locale'],

    events: {
      updateCalendarStartDate: function updateCalendarStartDate(startDate) {
        this.calendarStartDate = startDate.toString();
      }
    },

    methods: {
      isDisabled: function() {
        if (typeof this.advisorProfileId === 'undefined') {
          return true;
        } else {
          return false;
        }
      },

      isActive: function(tab) {
        if (tab === this.current) {
          return true;
        } else {
          return false;
        }
      },

      handleClick: function handleClick(event) {
        if (typeof this.advisorProfileId === 'undefined') {
          event.preventDefault();
        }
      },

      makeURI: function(name) {
        var advisorProfileParam = 'advisor_profile_id=' + this.advisorProfileId;
        var dateParam = 'calendar_start_date=' + encodeURIComponent(this.calendarStartDate);

        return this.routes(name, this.locale) + '?'+ advisorProfileParam + '&' + dateParam;
      },

      dataOriginalTitle: function(content) {
        if (this.isDisabled()) {
          return content;
        }
      }
    },

    template: '<div class="page-tabs">'+
                '<ul class="nav nav-pills nav-justified">'+
                  '<li :class="{ \'active\': isActive(\'list\') }">'+
                    '<a :href="makeURI(\'back_office_upcoming\')">{{ i18n.appointments_tab.appointments_list }}</a>'+
                  '</li>'+
                  '<li @click="handleClick" :class="{ \'apt-tabs-disabled\': isDisabled(), \'active\': isActive(\'calendar_appointments\') }">'+
                    '<a :href="makeURI(\'back_office_appointments_calendar\')" data-placement="top" data-toggle="tooltip" :data-original-title="dataOriginalTitle(i18n.appointments_tab.appointments_calendar_tooltip)">{{ i18n.appointments_tab.appointments_calendar_appointments }}</a>'+
                  '</li>'+
                  '<li @click="handleClick" :class="{ \'apt-tabs-disabled\': isDisabled(), \'active\': isActive(\'calendar_availabilities\') }">'+
                    '<a :href="makeURI(\'back_office_availabilities_calendar\')" data-placement="top" data-toggle="tooltip" :data-original-title="dataOriginalTitle(i18n.appointments_tab.appointments_calendar_tooltip)">{{ i18n.appointments_tab.appointments_calendar_availabilities }}</a>'+
                  '</li>'+
                '</ul>'+
              '</div>'

  });

  Vue.component('navbar', Navbar);

})(window, window.appointment_system.routes, window.appointment_system.i18n);
(function(win) {
  // Wrapper around Selectize JQuery Plugin
  //    http://selectize.github.io/selectize.js/
  var SelectizePicker = Vue.extend({
    props: {
      element: String,
      maxItems: {
        type: String,
        default: null
      },
      value: {
        twoWay: true
      }
    },

    data: function() {
      return {
        selectize: null
      }
    },

    watch: {
      value: function() {
        var that = this
        if (this.value !== this.selectize.items) {
          _.forEach(this.value, function(value) {
            that.selectize.addItem(value, false);
          });
        }
      }
    },

    ready: function ready() {
      var that = this;

      var selectize = $(this.element).selectize({
        maxItems: this.maxItems,
        plugins: ['remove_button'],
        onChange: function(value) {
          that.value = value;
        }
      });

      this.selectize = selectize[0].selectize;

      this.value = this.selectize.items;
    }
  });

  Vue.component('selectize-picker', SelectizePicker);

})(window);
