(function(win) {

  var ListSlicedAvailabilities  = win.appointment_system.ListSlicedAvailabilities,
      DaysRange                 = win.appointment_system.mixins.DaysRange,
      WeekPagination            = win.appointment_system.mixins.WeekPagination,
      i18n                      = win.appointment_system.i18n.components.availabilities_picker,
      routes                    = win.appointment_system.routes,
      N_DAYS                    = 7,
      Availability              = Models.Availability;

  var AvailabilitiesPicker = Vue.extend({
    mixins: [
      DaysRange({
        getter: 'days'
      }),
      WeekPagination({
        prevElSelector: '.prev-week',
        nextElSelector: '.next-week',
        // noPast option hide prevElSelector when needed
        noPast: true
      })
    ],

    props: {
      advisorProfile: {
        type: Object,
        required: true,
        coerce: function (string) {
          return !!string ? JSON.parse(string) : null;
        }
      },
      appointmentType: {
        type: Object,
        required: true,
        coerce: function (string) {
          return !!string ? JSON.parse(string) : null;
        }
      },
      campus: {
        type: Object,
        required: true,
        coerce: function (string) {
          return !!string ? JSON.parse(string) : null;
        }
      },
      // used to pass data to avoid on page load XHR
      prefetchedData: {
        coerce: function (string) {
          return !!string ? JSON.parse(string) : null;
        }
      }
    },

    data: function() {
      return {
        availabilities : {},
        startDate: moment().startOf('week').toDate(),
        // the fetcher is responsible of fetching availabilities and
        //  return an hash based with proper Time format
        fetcher: ListSlicedAvailabilities(this.appointmentType.id, this.advisorProfile.id, this.campus.id, N_DAYS),
        // begin of template attributes
        maxRows: [],
        days: {},
        ndays: N_DAYS,
        i18n: i18n,
        expandButtonLabel: i18n.see_more
        // end of template attributes
      }
    },

    watch: {
      startDate: 'loadAvailabilites',
      maxRows: 'expandIsVisible'
    },

    ready: function ready() {

      this.maxHeight = 260;
      this.tableElement = $(this.$el).find('.availabilities-picker-table:eq(0)');
      this.expandButton = $(this.$el).find('.expand-button');
      this.containerElement = $(this.$el).find('> .availabilities-picker-container');

      // If any data passed at the component, avoid to trigger a XHR
      if (!!this.prefetchedData) {
        this.update(
          this.fetcher.parseAvailabilities(
            this.prefetchedData,
            this.startDate
          )
        );
      } else {
        this.loadAvailabilites();
      }
    },

    methods: {

      expandIsVisible: function expandIsVisible() {
        this.expandVisible = this.tableElement.outerHeight() > this.maxHeight;
        this.expandToggle();
      },

      expandToggle: function expandToggle(event) {
        if (this.expandVisible) {

          this.containerElement.css({maxHeight: this.maxHeight });

          if (event) {
            this.containerElement.toggleClass('expanded');

            if (this.containerElement.hasClass('expanded')) {
              this.containerElement.removeAttr('style');
              this.expandButtonLabel = i18n.see_less;
            } else {
              this.expandButtonLabel = i18n.see_more;
            }
          } else {
            this.containerElement.removeClass('expanded');
            this.expandButtonLabel = i18n.see_more;
          }

        } else {
          this.expandButton.addClass("hide");
        }
      },

      // call the fetcher
      loadAvailabilites: function loadAvailabilites () {
        this.fetcher.fetch(this.startDate, this.update);
      },

      // update attributes using the fetcher and the renderer
      update: function update(availabilities) {
        if (availabilities) {
          this.updateDays();
          this.maxRows = this.computeMaxRows(availabilities);
          this.availabilities = availabilities;
        } else {
          // error
        }
      },

      computeMaxRows: function computeMaxRows(availabilities) {
        // _.maxBy is only available in lodash#4.0.0
        var availabilitiesLenByDay = _.map(availabilities, function(array) { return array.length; }),
            max = _.max(availabilitiesLenByDay);
        return new Array(max == -Infinity ? 0 : max);
      },

      askForAppointment: function(dateString, timeString){
        var availability = new Availability({
          start_at: moment(dateString + " " + timeString),
          campus: this.campus,
          appointment_types: [{
            id: this.appointmentType.id,
            name: this.appointmentType.name
          }],
          advisor_profile: this.advisorProfile
        });
        this.$dispatch("askForAppointment", availability)
      }

    },

    // the template use logic based on `days` and `maxRows` to deliver nice UX
    // - `days` is a hash with date_str as index and day name as value
    // - `maxRows` is an null-array that represent the max rows to draw on each day
    //    (based on max-availability on a day of the week)
    template: '<div class="availabilities-picker-container-wrapper">'+
                '<div class="availabilities-picker-container text-center">'+
                  '<a href="#" class="prev-week availabilities-picker-arrow"><i class="fa fa-caret-left"></i></a>'+
                  '<div class="table-responsive availabilities-picker-calendar">'+
                    '<table class="table table-condensed availabilities-picker-table">'+
                      '<tr class="header-days-name">'+
                        '<th v-for="(date_string, day_name) in days" class="text-center {{ availabilities[date_string].length ? \'\' : \'header-days-name-empty\' }}">'+
                          '{{ day_name }}'+
                        '</th>'+
                      '</tr>'+
                      '<tr v-for="(row, _) in maxRows" track-by="$index" class="content-availabilities-row">'+
                        '<template v-for="(date_string, day_name) in days">'+
                          '<td class="content-availabilities-row-item" v-if="availabilities[date_string].length">'+
                            '<a href="#" @click="askForAppointment(date_string, availabilities[date_string][row])" v-if="availabilities[date_string] && availabilities[date_string][row]">'+
                              '{{ availabilities[date_string][row] }}'+
                            '</a>'+
                          '</td>'+
                          '<td v-if="(availabilities[date_string].length == 0) && row == 0" class="content-availabilities-row-item-empty" rowspan="{{ maxRows.length }}">'+
                            '&nbsp;'+
                          '</td>'+
                        '</template>'+
                      '</tr>'+
                      '<template v-if="maxRows.length == 0">'+
                        '<tr class="availabilities-picker-empty">'+
                          '<td colspan="{{ ndays + 1 }}">'+
                            '<div class="availabilities-picker-empty-actions">'+
                              '{{ i18n.no_availabilities }} <a href="#" class="next-week">{{ i18n.next_week }}</a>'+
                            '</div>'+
                          '</td>'+
                        '</tr>'+
                      '</template>'+
                    '</table>'+
                  '</div>'+
                  '<a href="#" class="next-week availabilities-picker-arrow"><i class="fa fa-caret-right"></i></a>'+
                '</div>'+
                '<a href="#" @click.prevent="expandToggle" class="expand-button txt-color">{{ expandButtonLabel }}</a>'+
              '</div>'
  })

  Vue.component('availabilities-picker', AvailabilitiesPicker)

})(window)
