(function(win) {

  var routes        = win.appointment_system.routes,
      locale        = win.appointment_system.i18n_locale,
      i18nComponent = win.appointment_system.i18n.components.cancel_appointment_modal,
      i18nCommon    = win.appointment_system.i18n.common;

  var CancelAppointmentModal = Vue.extend({
    props: {
      appointments: Array
    },

    data: function data(){
      return {
        appointment: {},
        loading: false,
        i18nComponent: i18nComponent,
        student_message: ''
      };
    },

    events: {
      openCancelModal: function openCancelModal(appointment) {
        this.appointment = appointment;
        this.$broadcast('openModal');
      }
    },

    methods: {
      cancel: function cancel(event){
        var message = $(this.$children[0].$el).find("[name=message]")[0];

        if (message.checkValidity()) {
          this.loading = true;
          event.preventDefault();
          $.ajax({
            type: 'PATCH',
            url: routes('front_office_appointment', locale, this.appointment.id),
            contentType: 'application/json; charset=utf-8',
            data: JSON.stringify({
              appointment: { state: 'canceled_by_student', message: { body: this.student_message } }
            }),
            context: this
          }).done(function(response) {
            this.appointment.state = 'canceled_by_student';
            this.$broadcast('closeModal');
            this.loading = false;
          }).fail(function() {
            this.loading = false;
          });
        }
      }

    },

    template:
      '<front-office-modal>'+
        '<form>'+
          '<div class="modal-material__content">'+
            '<template v-if="!loading">'+
              '<h4 class="modal-title">{{ i18nComponent.title }}</h4>'+
              '<p>{{ i18nComponent.message }}</p>'+
              '<label class="text required"><abbr>*</abbr>{{ i18nComponent.message_label }}</label>'+
              '<textarea name="message" rows="4" cols="50" v-model="student_message" required></textarea>'+
            '</template>'+
            '<template v-if="loading">'+
              '<spinner></spinner>'+
            '</template>'+
          '</div>'+
          '<div class="modal-material__footer">'+
            '<button type="submit" class="btn-text btn-text--primary" @click.prevent="cancel">{{ i18nComponent.cancel_appointment }}</button>'+
          '</div>'+
        '</form>'+
      '</front-office-modal>'

  });
  Vue.component('cancel-appointment-modal', CancelAppointmentModal);
})(window);
