(function(win) {

  var i18n    = win.appointment_system.i18n.components.user_appointments,
      routes  = win.appointment_system.routes;

  var UserAppointmentsList = Vue.extend({
    props: {
      // used to pass data to avoid on page load XHR
      prefetchedData: {
        coerce: function (string) {
          return !!string ? JSON.parse(string) : null;
        }
      }
    },

    data: function() {
      return {
        appointments: [],
        i18n: i18n
      };
    },

    ready: function ready() {
      // If any data passed at the component, avoid to trigger a XHR
      if (!!this.prefetchedData) {
        this.appointments = this.formatAppointments(this.prefetchedData).sort(this.appointmentsSort);
      }

      this.appointments.sort();
    },

    events: {
      openCancelModal: function(appointment){
        this.$broadcast('openCancelModal', appointment);
      }
    },


    methods: {
      formatAppointments: function formatAppointments(appointments) {
        return _.map(appointments, function(appointment) {
          appointment.startDay = moment(appointment.start_at).format('dddd');
          appointment.startDate = moment(appointment.start_at).format('ll');
          appointment.startTime = moment(appointment.start_at).format('HH[:]mm');
          return appointment;
        });
      },

      appointmentsSort: function appointmentsSort(a, b) {
        var amilli  = moment(a.start_at).format('X'),
            bmilli  = moment(b.start_at).format('X');

        if(amilli < bmilli) return -1;
        if(amilli > bmilli) return 1;
        return 0;
      }

    },

    template: '<div class="bottom user-appointments-component">'+
                '<div class="section-title clearfix">'+
                  '<h1 class="title-color pull-left" v-if="!appointments || !appointments.length">'+
                    '<i class="fa fa-calendar title-color"></i>'+
                    '{{ i18n.title_no_apts }}'+
                  '</h1>'+
                  '<h1 class="title-color pull-left" v-if="!!appointments && appointments.length">'+
                    '<i class="fa fa-calendar title-color"></i>'+
                    '{{ i18n.title_apts }}'+
                  '</h1>'+
                  '<a href='+ routes('front_office') +' class="btn ghost-btn ghost-gray-button pull-right">{{ i18n.retake_apt }}</a>'+
                '</div>'+
                '<ul class="list-unstyled">'+
                  '<user-appointment v-for="appointment in appointments" :appointment="appointment">'+
                  '</user-appointment>'+
                '</ul>'+
                '<cancel-appointment-modal :appointments.sync="appointments"></cancel-appointment-modal>' +
              '</div>'
  });


  Vue.component('user-appointments-list', UserAppointmentsList);

})(window);
(function(window) {

  var InlineEditing = Vue.extend({

    props: {
      label: {
        type: String,
        required: true,
      },
      state: {
        type: String,
        required: true,
        twoWay: true
      },
      disabled: {
        type: Boolean,
        "default": false,
      }
    },

    events: {
      resetEditable: 'resetEditable'
    },

    computed: {
      getClasses: function getClasses() {
        return {
          "inlineEditing--edit": this.state === "edit",
          "inlineEditing--disabled": this.disabled,
        };
      },

      currentEditing: function currentEditing() {
        return this.state === "edit" && !this.disabled;
      }
    },

    methods: {

      resetEditable: function resetEditable() {
        this.state = "show";
      },

    },

    template: '<span :rel="state" class="inlineEditing" :class="getClasses">'+
                '<slot v-if="currentEditing"></slot>'+
                '<template v-else> {{ label }} </template>'+
              '</span>'

  });

  Vue.component('inline-editing', InlineEditing);

})(window);
