$(document).ready(function onReady() {
  var $doc = $(document);

  /*
  * Open FB Share popin
  */
  $doc.on('click', 'a.js-fb-shared', function jsFbSharedOnClick(e) {
    var title = 'Partager sur facebook';
    e.preventDefault();
    if (typeof e.currentTarget.dataset.fbTitle === 'string') {
      title = e.currentTarget.dataset.fbTitle;
    }
    window.open($(this).attr('href'), title, 'width=655, height=355');
  });

  /*
  * Close info box
  */
  $doc.on('click', 'a.js-infoBox--close', function jsInfoBoxCloseOnClick(e) {
    e.preventDefault();
    $(this).parent().parent().parent().fadeOut();
  });

  /*
  * Tag & redirect to live chat (dashboard)
  */
  $doc.on('click', '.js-livePush', function jsLivePushOnClick(e) {
    var dataLayer = JSON.parse(e.currentTarget.dataset.layer);
    window.location.href = e.currentTarget.dataset.href;
    JT.DataLayer.trackEvent('studentDashboard.featuredChat.click', dataLayer);
  });

  /*
  * Print page
  */
  $doc.on('click', '.js-printPage', function jsPrintPageOnClick(e) {
    e.preventDefault();
    print();
  });

  /*
  * Close Flash Message
  */
  $doc.on('click', '.js-closeFlashMessage', function jsCloseFlashMessageOnClick(e) {
    e.preventDefault();
    $(this).closest('.wrapper').remove();
  });

  /*
  * Generate mailto link
  */
  $doc.on('click', '.js-mailto', function jsMailtoOnClick(e) {
    e.preventDefault();
    e.currentTarget.href  = 'mailto:contact&#x40;jobteaser.com';
  });
});
(function() {
  var config;

  config = JT.config || {};

  log('Initializing JobTeaser frontend with', config);

  JT.ExceptionNotifier.configure(config, config.current_user);

  if (config.popup && config.popup.content) {
    JT.Popup.openRaw(config.popup.content, {
      className: config.popup["class"]
    });
  }

  JT.Flowplayer.configure(config.flowplayer_key, '/player/flowplayer.commercial-3.2.7.swf', '/player/flowplayer.controls-3.2.5.swf');

  _.each(['notice', 'warning', 'error', 'info'], function(key) {
    var message;
    if (config.notifications && (message = config.notifications[key])) {
      return JT.Notifications[key](message);
    }
  });

  if (JT.config.notifications.gtm_event) {
    JT.DataLayer.trackEvent(JT.config.notifications.gtm_event.message, _.omit(JT.config.notifications.gtm_event, 'message'));
  }

  JT.EasterEgg.init('http://videos.jobteaser.com/jobteaser-videos/jobteaser-developpeur.flv');

  $(document).initializeComponents();

  $('[data-toggle="tooltip"]').tooltip();

  $('input, textarea').placeholder();

  JT.FluidWidthVideos.init();

  new Vue({
    el: 'body'
  });

}).call(this);
